const { default: axios } = require("axios")

const apiUrl = 'http://localhost:3000/users'

async function getAllUsers(){
    const users = await axios.get(apiUrl)
    if (!users) {
        throw new Error('Cannot get users')
    }
    return users
}

function Login(){

    return (
        <div>
            <h1>Login</h1>
            <p>{getAllUsers()}</p>
        </div>
    )
}

export default Login
